// src/components/AboutUs.js
import React from 'react';

function AboutUs() {
    return (
        <section className="about-us">
            <h1>About WedSymphony</h1>
            <p>We are a wedding planning service dedicated to making your special day unforgettable.</p>
            <h2>Our Mission</h2>
            <p>Our mission is to provide seamless and stress-free wedding planning, from start to finish.</p>
            <h2>Our Vision</h2>
            <p>To be the leading wedding planner of choice for couples seeking elegance and sophistication.</p>
            <h2>Meet Our Team</h2>
            <p>Our dedicated team of professionals is here to turn your dream wedding into a reality.</p>
        </section>
    );
}

export default AboutUs;
